const InriaSans300 = `@font-face { font-family: 'Inria Sans'; font-style: normal; font-weight: 300; src: local('Inria Sans Light'), local('InriaSans-Light'), url('data:font/woff2;base64,') format('woff2'); }`;
const InriaSans300italic = `@font-face { font-family: 'Inria Sans'; font-style: italic; font-weight: 300; src: local('Inria Sans Light Italic'), local('InriaSans-LightItalic'), url('data:font/woff2;base64,') format('woff2'); }`;
const InriaSansRegular = `@font-face { font-family: 'Inria Sans'; font-style: normal; font-weight: 400; src: local('Inria Sans Regular'), local('InriaSans-Regular'), url('data:font/woff2;base64,') format('woff2'); }`;
const InriaSansItalic = `@font-face { font-family: 'Inria Sans'; font-style: italic; font-weight: 400; src: local('Inria Sans Italic'), local('InriaSans-Italic'), url('data:font/woff2;base64,') format('woff2'); }`;
const InriaSans700 = `@font-face { font-family: 'Inria Sans'; font-style: normal; font-weight: 700; src: local('Inria Sans Bold'), local('InriaSans-Bold'), url('data:font/woff2;base64,') format('woff2'); }`;
const InriaSans700italic = `@font-face { font-family: 'Inria Sans'; font-style: italic; font-weight: 700; src: local('Inria Sans Bold Italic'), local('InriaSans-BoldItalic'), url('data:font/woff2;base64,') format('woff2'); }`;
